import styled from 'styled-components'

export const CardStyle = styled.div`

    .card {
        width: 200px;
        height: 300px;
        background: #1E212A;
        display: flex;
        justify-content: center;
    }

    .centralBorder {
        background: #00FF7F;
        width: 190px;
        height: 290px;
        margin-top: 5px;
    }


`
